    "pea-island-national-wildlife-refuge-narrative-report-september-1-through-december-31-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Pea Island NWR
    outlines Refuge accomplishments from September through December of 1963. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, furbearers, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and vegetation
    control. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, hunting, violations, and safety. Items of interest, N-R forms,
    and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
